      DynVisBox.style.gridTemplateColumns = `repeat(${bitCount}, 1fr)`;
      DynVisBox.style.gridTemplateRows = `repeat(${maxGenerations  + 1}, 1fr)`;
      //更新xy軸
      updateAxes(bitCount, displayGenerations.length);
      //更新Fitness
